import { Field } from 'formik'
import React from 'react'

const SelectCity = ({label, name, options, ...rest}) => {
    return (
        <div className="form-control">
            <label htmlFor={name}>{label}</label>
            <Field
            as='select'
            id={name}
            name={name}
            {...rest}
            >
                {
                    options.map(option => {
                        return(
                            <option
                            key={option.value}
                            value={option.value}
                            >
                                {option.key}

                            </option>
                        )

                    })
                }
            </Field>
        </div>
    )
}

export default SelectCity
